import Navbar from "./components/NavBar/navbar";
import Intro from "./components/Intro/intro";
import { OrbitSpace } from "orbit-space";

function App() {
  return (
    <>
      <div className="App">
        <OrbitSpace>
          <Navbar />
          <Intro />
        </OrbitSpace>
      </div>
    </>
  );
}

export default App;
